import React from "react";
import "./Programs.css";
const Programs = () => {
    return <div className="programs" id="programs">
        {/*  header*/}
        <div className="programs-header">
            <span>Explore our</span>
            <span>Programs</span>
            <span>to shape you</span>
        </div>
    </div>;
};

export default Programs;
